import React from "react";
import { Link } from "react-router-dom";

const Headers = () => {
  return (
    <div className="header">
      <nav>
        <h1>
          <Link to="/">VICKDdev</Link>
        </h1>
      </nav>
    </div>
  );
};

export default Headers;
